INSERT INTO `comm` VALUES (1, '广智苑C区106\r\n', 1, '2009-07-16 12:52:52.000000', '计算机协会协会简介，是一个科技教育组织，其中最早的创立于1947年，是世界上第一个科学性及教育性计算机学会，总部设在美国纽约。ACM致力于提高信息技术在科学、艺术等各行各业的应用水平。从成立之初ACM就开始为会员的信息、思想和发现提供交流平台，截至2007年ACM已经拥有100多个国家和地区的超过83，000名专业会员，他们来自企业、学术机构和政府组织\r\n计算机协会协会简介，是一个科技教育组织，其中最早的创立于1947年，是世界上第一个科学性及教育性计算机学会，总部设在美国纽约。ACM致力于提高信息技术在科学、艺术等各行各业的应用水平。从成立之初ACM就开始为会员的信息、思想和发现提供交流平台，截至2007年ACM已经拥有100多个国家和地区的超过83，000名专业会员，他们来自企业、学术机构和政府组织', 1, 3240.00, '计算机协会', '123456', 96542, 412, '学术型', 'jsjxh', 0);
INSERT INTO `comm` VALUES (2, '广智苑C区230', 2, '2001-10-15 12:58:14.000000', '雨花音乐社是一个交流音乐的社团，是学生提高音乐素养的团体，是音乐爱好者展现自己的平台。音乐社致力于提供一个音乐爱好者交流的平台，兼顾学校的艺术表演任务，逐步开展歌唱交流比赛等其他活动', 2, 1531.00, '雨花音乐社团', '123456', 45120, 413, '艺术型', 'yhyys', 0);
INSERT INTO `comm` VALUES (3, '广智苑C区530', 1, '2011-07-04 13:00:15.000000', '数学建模协会是一个科研学术性质的社团，面向全校，主要负责每年校建模，五一建模联赛，全国建模比赛的组织，培训和参赛事宜，与院内的领导，老师都有着密切的联系和良好的关系。', 3, 1052.00, '数学建模协会', '123456', 8486, 416, '学术型', 'sxjmxh', 0);
